The sides of this parallelogram measure 7,9, $8y-1$ and $2x+3$ units, consecutively. What is the value of $x+y$?

[asy]draw((0,0)--(21,0)--(30,25)--(9,25)--cycle);
label("$8y-1$",(10,0),S);
label("9",(25.5,12.5),E);
label("7",(19.5,25),N);
label("$2x+3$",(4.5,12.5),W);
[/asy]

In the diagram below, $\overline{AB}\parallel \overline{CD}$ and $\angle AXF= 118^\circ$.  Find $\angle FYD$.

[asy]
unitsize(1inch);
pair A,B,C,D,X,Y,EE,F;
A = (0,0);
B=(1,0);
C = (0,0.8);
D=(1,0.8);
EE = (0.35,-0.3);
F = (0.8,1.1);
draw(EE--F);
draw(A--B);
draw(C--D);
dot(A);
dot(B);
dot(C);
dot(D);
dot(EE);
dot(F);
label("$E$",EE,S);
label("$F$",F,N);
X = intersectionpoint(A--B,EE--F);
Y = intersectionpoint(C--D,EE--F);
label("$X$",X,NNW);
label("$Y$",Y,NNW);
label("$A$",A,W);
label("$B$",B,E);
label("$C$",C,W);
label("$D$",D,E);
dot(X);
dot(Y);
[/asy]

In Perfectville, the streets are all $20$ feet wide and the blocks they enclose are all squares of side length $400$ feet, as shown.  Sarah runs around the block on the $400$-foot side of the street, while Sam runs on the opposite side of the street.  How many more feet than Sarah does Sam run for every lap around the block?

[asy]
draw((0,0)--(10,0));
draw((1,1)--(9,1));
draw((0,0)--(0,10));
draw((0,10)--(10,10));
draw((10,10)--(10,0));
draw((9,1)--(9,9));
draw((9,9)--(1,9));
draw((1,9)--(1,1));
fill((1,1)--(1,9)--(9,9)--(9,1)--cycle,gray);
draw((9,10.5)--(9,11));
draw((10,10.5)--(10,11));
draw((9,10.75)--(10,10.75));
label("20'",(9.5,11),N);
draw((10.5,9)--(11,9));
draw((10.5,10)--(11,10));
draw((10.75,9)--(10.75,10));
label("20'",(11,9.5),E);
label("400'",(5,9),S);
label("400'",(9,5),W);
[/asy]

Cutting equilateral triangle $BFC$ out of square $ABCD$ and translating it to the left of the square creates the shaded figure $ABFCDE$. The perimeter of square $ABCD$ was 48 inches. What is the perimeter, in inches, of $ABFCDE$?

[asy]
filldraw((0,0)--(sqrt(3),1)--(sqrt(3)+2,1)--(2,0)--(sqrt(3)+2,-1)--(sqrt(3),-1)--(0,0)--cycle,gray,linewidth(1));
draw((sqrt(3),1)--(sqrt(3),-1),linewidth(1));
draw((sqrt(3)+2,-1)--(sqrt(3)+2,1)--(2,0)--(sqrt(3)+2,-1)--cycle,dashed);

label("A",(sqrt(3),1),N);
label("B",(sqrt(3)+2,1),N);
label("C",(sqrt(3)+2,-1),S);
label("D",(sqrt(3),-1),S);
label("E",(0,0),W);
label("F",(2,0),N);
[/asy]

